        public void unlockCurrent()
        {
            unlocked.Add(tracking);
            unlockedSet.Add(tracking.getId());
            Task.Run(async () =>
            {
                UnlockedPosts temp = await conn.getPostAttachmentAsync(tracking.getId());
                temp.obsID = tracking.getId();
                uvm.addUnlockedPost(tracking, temp);
                tracking = null;
            });
            
        }

        public void testUnlockCurrent()
        {
            Task.Run(async () =>
            {
                await Task.Delay(15000);
                Console.WriteLine("Test initiated");
                UnlockedPosts temp = await conn.getPostAttachmentAsync(384);
                temp.obsID = 384;
                uvm.testAddUnlockedPost(384, temp);
                Console.WriteLine("Test end");
            });
        }

        /**
* Reads the cookie file for information about the user.
*/
        public void ReadUser()
        {
            var filename = System.IO.Path.Combine(Environment.GetFolderPath(Environment.SpecialFolder.Personal), "myFile1.txt");
            if (File.Exists(filename))
            {
                newUser = false;
                String fileInfo = System.IO.File.ReadAllText(filename);
                using (StreamReader file = new StreamReader(filename))
                {
                    int lineCounter = 0;
                    int counter = 0;
                    string ln;

                    while ((ln = file.ReadLine()) != null)
                    {
                        
                        if (ln.Contains("*"))
                            counter++;
                        else if (counter == 0)
                        {
                            if (lineCounter == 0)
                            {
                                category = int.Parse(ln);
                                Console.WriteLine("The category is: " + category);
                            }
                            else
                            {
                                distance = int.Parse(ln);
                                Console.WriteLine("The distance is: " + distance);
                            }
                        }
                        else if (counter == 1) { 
                            markedSet.Add(int.Parse(ln));
                            forbiddenSet.Add(int.Parse(ln));
                        }
                        else if (counter == 2) { 
                            unlockedSet.Add(int.Parse(ln));
                            forbiddenSet.Add(int.Parse(ln));
                        }
                        else
                        {
                            tracker = int.Parse(ln);
                        }
                        lineCounter++;
                    }
                    file.Close();
                    Console.WriteLine("The number of posts in marked is: " + markedSet.Count);
                    foreach (int x in markedSet)
                    {
                        Console.Write(x + ", ");
                    }
                }
            }
        }

        public void SaveUser()
        {
            String infoToSave = "";
            infoToSave = category + "\n"; 
            infoToSave += distance + "\n";
            infoToSave += "*\n";
            foreach (int x in markedSet)
            { // Saving info from unlocked
                infoToSave += x + "\n";
            }
            infoToSave += "*\n"; // To indicate the end of previous
            foreach (int x in unlockedSet)
            { // Saving info from unlocked
                infoToSave += x + "\n";
            }
            infoToSave += "*\n"; // To indicate the end of previous
            if(tracking != null)
                infoToSave += tracking.getId();
            var filename = System.IO.Path.Combine(Environment.GetFolderPath(Environment.SpecialFolder.Personal), "myFile1.txt");
            System.IO.File.WriteAllText(filename, infoToSave);
            Console.WriteLine(infoToSave);
        }

        public void saveImage(int obsId, byte[] image)
        {
            var filename = System.IO.Path.Combine(Environment.GetFolderPath(Environment.SpecialFolder.Personal), obsId + ".dat");
            System.IO.File.WriteAllBytes(filename, image);
            Console.WriteLine("The image ought to have been saved ___________________________________________________---------------------------_______________--------------______________");
        }

        // Method to set which post is being tracked.
        public void addTracker(int observationId)
        {
            foreach (Post x in marked)
            {
                if (x.getId() == observationId)
                {
                    tracking = x;
                    //marked.Remove(x);
                }
            }
        }
       

        public List<Post> getFeed()
        {
            return feed;
        }

        public List<Post> getUnlocked()
        {
            return unlocked;
        }

        public List<Post> getMarked()
        {
            return marked;
        }

        public byte[] readImage(int obsId)
        {
            Console.WriteLine("Trying to read the image for unlocked.");
            var filename = System.IO.Path.Combine(Environment.GetFolderPath(Environment.SpecialFolder.Personal), obsId + ".dat");
            if (File.Exists(filename))
            {
                return System.IO.File.ReadAllBytes(filename);
            }
            return null;
        }
    }

